import React from 'react';

function DietObesity2() {
  return (
    <div className="diet-page">
      <h1>Diet for Obesity Level 2</h1>
      <p>For Obesity Level 2, focus on an intensive dietary plan:</p>
      <ul>
        <li>Eat a variety of low-calorie, nutrient-dense foods.</li>
        <li>Limit intake of processed and high-sugar foods.</li>
        <li>Incorporate high-fiber foods and lean proteins.</li>
        <li>Adhere to a structured meal plan with smaller, frequent meals.</li>
        <li>Combine dietary changes with regular exercise and professional guidance.</li>
      </ul>
    </div>
  );
}

export default DietObesity2;
